import React, { Component } from "react";
import { TextField, Container, Button, Tabs, Tab } from "@material-ui/core";

export default class Lgon extends Component {
  TextFieldStyle = {};

  render() {
    return (
      <div>
        <Tabs>
          <Tab value={0} label="LOGIN">
            LOGIN
          </Tab>
          <Tab value={1} label="REGISTER">
            REGISTER
          </Tab>
        </Tabs>
        <h2>LOGIN</h2>
        <Container>
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="outlined"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="outlined"
            type="password"
          />
          <br />
          <Button
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            LOGIN
          </Button>
        </Container>
      </div>
    );
  }
}
